h embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>','Privacy Policy','','inherit','closed','closed','','3-revision-v1','','','2018-07-31 09:06:10','2018-07-31 09:06:10','',3,'http://vccw.test/archives/24',0,'revision','',0),(25,1,'2018-07-31 09:06:10','2018-07-31 09:06:10','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://vccw.test/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2018-07-31 09:06:10','2018-07-31 09:06:10','',2,'http://vccw.test/archives/25',0,'revision','',0),(26,1,'2018-07-31 09:06:10','2018-07-31 09:06:10','%5B%7B%22title%22%3A%22Status%22%2C%22content%22%3A%22%3Ctable+class%3D%5Cu0027diff%5Cu0027%3E%5Cn%3Ccol+class%3D%5Cu0027content%5Cu0027+%5C%2F%3E%3Ctbody%3E%5Cn%3Ctr%3E%3Ctd+class%3D%5Cu0027diff-deletedline%5Cu0027%3Epublish%3C%5C%2Ftd%3E%3Ctd%3E%26nbsp%3B%3C%5C%2Ftd%3E%3Ctd+class%3D%5Cu0027diff-addedline%5Cu0027%3Etrash%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%5Cn%5Cn%3C%5C%2Ftbody%3E%5Cn%3C%5C%2Ftable%3E%22%7D%2C%7B%22title%22%3A%22URL%22%2C%22content%22%3A%22%3Ca+href%3D%5Cu0022http%3A%5C%2F%5C%2Fvccw.test%5C%2Fsample-page__trashed%5Cu0022%3Ehttp%3A%5C%2F%5C%2Fvccw.test%5C%2Fsample-page__trashed%3C%5C%2Fa%3E%22%7D%2C%7B%22title%22%3A%22Environment+Variables%22%2C%22content%22%3A%22%3Ctable+class%3D%5Cu0022table-logbook%5Cu0022%3E%3Ctr%3E%3Cth%3EREMOTE_ADDR%3C%5C%2Fth%3E%3Ctd%3E%3Cpre%3E192.168.33.1%3C%5C%2Fpre%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3Ctr%3E%3Cth%3EHTTP_X_FORWARDED_FOR%3C%5C%2Fth%3E%3Ctd%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3Ctr%3E%3Cth%3EHTTP_CLIENT_IP%3C%5C%2Fth%3E%3Ctd%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3Ctr%3E%3Cth%3EHTTP_USER_AGENT%3C%5C%2Fth%3E%3Ctd%3E%3Cpre%3EMozilla%5C%2F5.0+%28X11%3B+Linux+x86_64%29+AppleWebKit%5C%2F537.36+%28KHTML%2C+like+Gecko%29+Chrome%5C%2F67.0.3396.99+Safari%5C%2F537.36%3C%5C%2Fpre%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3Ctr%3E%3Cth%3EHTTP_HOST%3C%5C%2Fth%3E%3Ctd%3E%3Cpre%3Evccw.test%3C%5C%2Fpre%3E%3C%5C%2Ftd%3E%3C%5